import React, { useEffect, useState } from "react";
import axios from "axios";

function Form() {
    const [data, setData] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:19006/form')
        .then(res => console.log(res))
        .catch(err => console.log(err));
    },[])
  return (
    <div>

    </div>
  )
}

export default Form
